INSERT INTO complexity_level (id, title, description, service_category_id, complexity)
VALUES  ('a68801b7-181f-4a13-bbf7-4ffe4de37e17', 'Low complexity', 'Service user has prior experience of successfully dealing with their own finance, benefit and debt needs. Service users circumstances may be currently leading to significant financial pressure. Service user will require some advice, guidance and/or support across some specific but limited finance, benefit and debt needs, but will be able to support themselves with other aspects.', '17c514b3-947c-439c-b7cb-b2779429feb8', 'LOW'),
        ('932169a2-6813-4057-a828-40547c5925e3', 'Medium complexity', 'Service user has limited prior experience of successfully dealing with their own finance, benefit and debt needs. Service users circumstances are currently leading to significant financial pressure and they require support to address these needs. Service user will need either significant support to meet a limited number of needs – for instance the Service user may have additional needs (i.e. learning difficulties) or other challenges which impact on their ability to fully manage – or they will need limited support to meet a wider range of finance, benefit and debt - related needs.', '17c514b3-947c-439c-b7cb-b2779429feb8', 'MEDIUM'),
        ('31fff201-25c5-40fe-a1c4-7444ab40e987', 'High complexity', 'Service user has minimal or no prior experience of successfully dealing with their own finance, benefit and debt needs and does not have necessary identification documents or bank account. Service users circumstances are currently leading to extreme financial pressure and/or they have complex finance, benefit and debt-related needs which require a range of Activities to address these needs. Service user may have a poor finance history and wider complex needs, such as mental health issues, substance misuse and/or addiction issues.', '17c514b3-947c-439c-b7cb-b2779429feb8', 'HIGH'),
        ('dcee082b-ddbb-4fce-9bbd-070127716941', 'Low complexity', 'Person(s) on Probation who is highly motivated and has had sustained period of abstinence. Person(s) on Probation has successfully engaged in a period of treatment but requires support to sustain recovery.', 'd9cd7b8b-2ce0-4553-8f56-a7ecfa5cc9e5', 'LOW'),
        ('9fe31645-8d79-4306-9da0-2533ee0c725e', 'Medium complexity', 'Person(s) on Probations who has had lapses/crises that may lead to relapse and/or is at a transition point, e.g. from prison into community. Person(s) on Probation has a moderate level of motivation but requires a high level of support for dependencies linked to re-offending. Person(s) on Probations who are subject to a Community Sentence Treatment Requirement and need wraparound support to aid engagement. Person(s) on Probation does not meet the threshold for secondary provision treatment services and/or are deemed unsuitable following assessment for treatment as part of a Community Sentence Treatment Requirement.', 'd9cd7b8b-2ce0-4553-8f56-a7ecfa5cc9e5', 'MEDIUM'),
        ('6e77cad6-50ac-4a68-8622-52a28f9403d7', 'High complexity', 'Person(s) on Probations may include those with chronic substance misuse issues, those with additional needs which might include dual diagnosis and/or a chaotic lifestyle linked to their dependency. Person(s) on Probation does not meet the threshold for secondary provision treatment services and/or are deemed unsuitable following assessment for treatment as part of a Community Sentence Treatment Requirement. However, Person(s) on Probation has identifiable substance misuse, alcohol misuse, prescription medication misuse, or other dependencies linked to re-offending. Person(s) on Probation has a history of poor engagement with treatment services and requires a high level of motivation and support to engage with treatment.', 'd9cd7b8b-2ce0-4553-8f56-a7ecfa5cc9e5', 'HIGH'),
        ('8247528b-8a76-4c09-8b6d-2c0402958213', 'Low complexity', 'Service user has prior experience of successfully dealing with their own finance, benefit and debt needs. Service users circumstances may be currently leading to significant financial pressure. Service user will require some advice, guidance and/or support across some specific but limited finance, benefit and debt needs, but will be able to support themselves with other aspects.', '68084e67-064a-4a19-8244-ec37e99a4fd4', 'LOW'),
        ('e3abfae9-3012-4328-acd0-d1858de8c096', 'Medium complexity', 'Service user has limited prior experience of successfully dealing with their own finance, benefit and debt needs. Service users circumstances are currently leading to significant financial pressure and they require support to address these needs. Service user will need either significant support to meet a limited number of needs – for instance the Service user may have additional needs (i.e. learning difficulties) or other challenges which impact on their ability to fully manage – or they will need limited support to meet a wider range of finance, benefit and debt - related needs.', '68084e67-064a-4a19-8244-ec37e99a4fd4', 'MEDIUM'),
