        ('a0ee4498-bee7-40f4-9c02-455be75f1bb3', 'High complexity', 'Service user has minimal or no prior experience of successfully dealing with their own finance, benefit and debt needs and does not have necessary identification documents or bank account. Service users circumstances are currently leading to extreme financial pressure and/or they have complex finance, benefit and debt-related needs which require a range of Activities to address these needs. Service user may have a poor finance history and wider complex needs, such as mental health issues, substance misuse and/or addiction issues.', 'c61f93f1-99b5-45a7-b470-24a6d981692a', 'HIGH'),
        ('0d6a7e24-2c61-4ca7-ac09-ec6f754dc6e5', 'Low complexity', 'Service user has satisfactory basic numeracy & literacy skills. The Service user has previously been employed though there may be gaps with periods of inactivity due to redundancy/periods of imprisonment. There has been no critical development need to find a new job in their previous field of competence. The Service user values benefits of working but needs guidance to re-enter the workforce, change jobs or career path.', 'ca374ac3-84eb-4b91-bea7-9005398f426f', 'LOW'),
        ('178ec337-0ec9-422c-b9da-ea969fdcf98a', 'Low complexity', 'Service user is not overly reliant on friends /family or others to supplement daily living expenses or regular outgoings. Service user''s circumstances may be currently leading to significant financial pressure but they are able to support themselves through legitimate means.', '96a63c39-4371-4f17-a6ec-265755f0cf7b', 'LOW'),
        ('a8860894-2610-4070-aa66-72089417ceb2', 'Low complexity', 'Service user lacks confidence to engage in community activities and/or spend a significant amount of time alone.  Service user recognises the value of strong pro-social support groups but is struggling to develop these fully. Service user has got one or more close friends not involved in criminal activity and/or spends limited time each week with non-offending peers or some affiliation to non-offending groups and activities, but does not have a central role. Service user may recognise that some lifestyle choices and associations have affected their behaviour and may trigger re-offending, such as illegal drug use, alcohol, gambling, peer choice, limited medium and long-term goals.', 'b84f4eb7-4db0-477e-8c59-21027b3262c5', 'LOW'),
        ('ddc8ee4a-403e-47cc-9af1-815938429bbc', 'Low complexity', 'Service user has positive contact with some family or some significant others and may have positive support of family members. Service user has previously lost contact with family and recently renewed contacts but there remain some difficulties.', '9556a399-3529-4993-8030-41db2090555e', 'LOW'),
        ('85aa5a57-62d3-4b9d-9642-248e7be4bebc', 'Low complexity', '[up to 4 Sessions (pre-release virtual contact)] Service user has a low risk of reoffending. Service user has limited family support or engagement with community services and there may be barriers to achieving community integration.', 'c036826e-f077-49a5-8b33-601dca7ad479', 'LOW'),
        ('b948a17e-6334-4a68-915c-a2f8b0066a7a', 'Low complexity', 'Service User has positive contact with some family or some significant others and may have positive support of family members. Service User has previously lost contact with family and recently renewed contacts but there remain some difficulties.', '9232541b-6b1c-455d-8153-ab2784bf4593', 'LOW'),
