        ('795a70a5-46af-4608-990e-b54ea5136a21', 'Low complexity', 'Person(s) on Probation who is highly motivated and has had sustained period of abstinence. Person(s) on Probation has successfully engaged in a period of treatment but requires support to sustain recovery.', '57d3cedb-29f8-4316-9c22-9d6d0631ffab', 'LOW'),
        ('ab17dc4a-3f93-4ae5-a70d-2905b86b256c', 'Medium complexity', 'Service user has gaps in basic numeracy and literacy skills. The Service user has no or limited working experience. The Service user has partially completed vocational training but requires support with building confidence and motivation to develop training and/or employability skills, and also require support and coaching to develop or enhance skills to obtain and sustain employment.', 'ca374ac3-84eb-4b91-bea7-9005398f426f', 'MEDIUM'),
        ('d771ae5e-01d4-43b0-a941-99b2c0c52d29', 'Medium complexity', 'Service user may commit crimes ''on the side'' to supplement legal income or may rely on others for what they consider to be necessities. Service user may be unable to pay debts because of other ''demands''.', '96a63c39-4371-4f17-a6ec-265755f0cf7b', 'MEDIUM'),
        ('f6a063e4-7daa-4cf6-9042-22476f8b5ed9', 'Medium complexity', 'Service user who has had lapses/crises that may lead to relapse and/or is at a transition point, e.g. from prison into community. Service user has a moderate level of motivation but requires a high level of support.', '76bcdb97-1dea-41c1-a4f8-899d88e5d679', 'MEDIUM'),
        ('707a0244-6bfe-4f0a-80d9-5e79498e81a8', 'Medium complexity', 'Service user recognises the value of strong pro-social support groups but does not belong to any and shows limited interest in doing so. Service user spends the majority of their time alone or using social networking sites or web based sites but with limited face-to-face social interaction. Service user is aware of the value of positive attachments but does not have any at present and/or spends a significant amount of time with pro-criminal social groups. Service user engages in anti-social behaviours including (non-addiction) drug use, regular alcohol use, problematic gambling, poor behaviour that impact negatively on the wider community and/or displays impulsiveness in risk taking activities, e.g. putting themselves or others at risk of harm.', 'b84f4eb7-4db0-477e-8c59-21027b3262c5', 'MEDIUM'),
        ('8e409327-e3ab-4c91-9300-2f61a409789f', 'Medium complexity', 'Service user describes more difficulties in relationships with family and significant others or is in the process of resolving difficulties. Service user has a mix of good and difficult relationships with family and significant others.', '9556a399-3529-4993-8030-41db2090555e', 'MEDIUM'),
        ('46c1ae33-f90b-4dfc-83f7-6eec49209084', 'Medium complexity', 'Service user has diagnosed documented psychological problems that are being managed well but requires support to maintain engagement. Service user has coping strategies but needs assistance. Service user shows signs of stress in meetings and requires support to effectively engage.', '8221a81c-08b2-4262-9c1a-0ab3c82cec8c', 'MEDIUM'),
        ('64eb3c83-c562-4a63-9182-68a3a7725463', 'Medium complexity', '[up to 8 sessions (Including up to 2 pre-release face-to-face contacts)] Service user has medium risk of reoffending.  Service user has limited family support or engagement with community services and there may be barriers to achieving community integration. Service user has additional vulnerabilities requiring support through release and may have a pattern of non-compliance, e.g. recalls or failure to attend appointments.', 'c036826e-f077-49a5-8b33-601dca7ad479', 'MEDIUM'),
        ('f7d11ff0-e198-4241-9221-816ace3fbfab', 'Medium complexity', 'Service User describes more difficulties in relationships with family and significant others or is in the process of resolving difficulties. Service User has a mix of good and difficult relationships with family and significant others.', '9232541b-6b1c-455d-8153-ab2784bf4593', 'MEDIUM'),
