        ('110f2405-d944-4c15-836c-0c6684e2aa78', 'Medium complexity', 'Service user is at risk of homelessness/is homeless, or will be on release from prison. Service user has had some success in maintaining a tenancy but may have additional needs e.g. Learning Difficulties and/or Learning Disabilities or other challenges currently.', '428ee70f-3001-4399-95a6-ad25eaaede16', 'MEDIUM'),
        ('c86be5ec-31fa-4dfa-8c0c-8fe13451b9f6', 'High complexity', 'Service user is homeless or in temporary/unstable accommodation, or will be on release from prison. Service user has poor accommodation history, complex needs and limited skills to secure or sustain a tenancy.', '428ee70f-3001-4399-95a6-ad25eaaede16', 'HIGH'),
        ('439c6dab-0dd6-4eb9-8a4a-c69d3490e940', 'High complexity', 'Service user lacks basic literacy & numeracy skills and/or may have Learning Difficulties and/or Learning Disabilities. The Service user has no or limited working experience and/or have no qualifications or current qualifications and/or may have many barriers and restrictions to employment due to the nature of their offences (e.g. sex offender or violence). The Service user requires significant support and coaching to build motivation, confidence and basic skills to enter employment / training.', 'ca374ac3-84eb-4b91-bea7-9005398f426f', 'HIGH'),
        ('65a682a7-9621-4dab-8040-08f3109321f8', 'High complexity', 'Service user income comes from the proceeds of crime, e.g. dealing drugs, robbery or stolen goods.  Service user relies on others for necessities and luxuries and servicing debts to illegitimate external sources. Service user may be unable to meet household and essential bills.', '96a63c39-4371-4f17-a6ec-265755f0cf7b', 'HIGH'),
        ('cf1fb9d3-5092-42dd-b8da-d9cedf96addc', 'High complexity', 'Service user who is sentenced to Community Sentence where there is a Dual Diagnosis and substance misuse treatment. Service user does not meet the threshold for secondary provision and/or are deemed unsuitable following assessment for treatment as part of a Community Sentence Treatment Requirement.  However, Service user has identifiable substance misuse, alcohol misuse, prescription, gambling or other dependencies linked to re-offending. Service user has a history of poor engagement with treatment services and requires a high level of motivation and support to engage with treatment.', '76bcdb97-1dea-41c1-a4f8-899d88e5d679', 'HIGH'),
        ('005566a2-ca85-471c-9ac0-38f3aa749092', 'High complexity', 'Service user has limited or no attachments/associations that are unrelated to offending behaviour. Service user does not belong to community groups or pro-social organised activities and does not place value on being part of them. Service user has no strong relationships outside of immediate family with people who don''t offend and/or spends the majority of their time alone using social networking sites or web based sites but with no face-to-face social interaction. Service user has strong links to county lines, gang affiliations, exposure to extremism, at risk of radicalisation, certain online offences.', 'b84f4eb7-4db0-477e-8c59-21027b3262c5', 'HIGH'),
        ('52ca5958-56c6-4ae3-99ca-86180265f717', 'High complexity', 'Service user has little or no contact with family and does not care about what family thinks feel or expects. Service user describes hostile, indifferent uncaring relationships with family and significant others. Service user''s relationship has recently ended or is likely to do so.', '9556a399-3529-4993-8030-41db2090555e', 'HIGH'),
        ('64a1b7ba-305e-4bcc-b427-01b575ace941', 'High complexity', 'Service user has suffered psychological and mental health problems over a period of time which is documented, and needs significant level of support to engage with service provision. Service user is socially isolated and struggles with numerous aspects of daily life.', '8221a81c-08b2-4262-9c1a-0ab3c82cec8c', 'HIGH'),
        ('f1eebd5e-4a0f-457e-b1a8-62e8c7de1afd', 'High complexity', '[up to 12 sessions (including up to 3 pre-release face-to-face contacts)] Service user has high risk of reoffending. Service user has limited family support, a lack of social networks or minimal engagement with community services and there may be barriers to achieving community integration. Service user has additional vulnerabilities requiring support throughout release with a pattern of non-compliance and a high likelihood of non-compliance in early weeks of release, e.g. recalls or failure to attend appointments.', 'c036826e-f077-49a5-8b33-601dca7ad479', 'HIGH'),
        ('2e8db418-35c7-401f-bfd5-ad6cc44b3b63', 'High complexity', 'Service User has little or no contact with family and does not care about what family thinks feel or expects. Service User describes hostile, indifferent uncaring relationships with family and significant others. Service User''s relationship has recently ended or is likely to do so.', '9232541b-6b1c-455d-8153-ab2784bf4593', 'HIGH'),
